import React, { useState, useEffect} from "react";

function Example() {
  const [count, setCount] = useState(0);

  useEffect(() => {
    document.title = `You clicked `
  })

  return (
    <input
      type="text"
      value={email}
      onChange={event=> setEmail(event.target.value)}
      />
  );
}
